import React from 'react';

const Contact = () => (
  <section id="contact">
    <h2>Contact</h2>
    <p><b>Email:</b> bkeerthanapgpcet@gmail.com</p>
    <p><b>LinkedIn:</b> https://www.linkedin.com/in/keerthana-bala-624538333/
    </p>
    <a className='top' href='#head'>Back to top</a>
  </section>
);

export default Contact;
